**Key Psychological Mechanisms Involved:**

The key psychological mechanisms involved in a responder's decision to accept or reject an offer in this economic game are:

1. **Equity/Fairness:** Responders are likely to evaluate the proposed split based on how fair they perceive it to be relative to their own contribution (token_self) and the opponent's contribution (token_opp).  A perceived unfair offer (where the split favors the proposer disproportionately) will likely result in a lower utility.

2. **Self-Interest:** Responders will also consider their own monetary gain (split_self). A higher monetary gain will increase the utility of accepting the offer.

**How These Mechanisms Interact:**

These two mechanisms are not mutually exclusive. A responder might accept an offer that is slightly unfair if the monetary gain is sufficiently high.  Conversely, even a perfectly fair offer might be rejected if the monetary gain is too low.  The interaction between fairness and self-interest is crucial in determining the utility of an offer.

**What Mathematical Form Could Capture These Interactions:**

A simple model could capture this interaction using a weighted sum of fairness and self-interest.  The weights will reflect the relative importance of fairness versus self-interest for the responder.


**What Parameters Would Be Needed to Calibrate the Model:**

We need two learnable parameters:

1. **Fairness Weight (fairness_weight):** This parameter represents the importance of fairness in the responder's decision-making. A higher value indicates that the responder places more weight on fairness.

2. **Self-Interest Weight (self_interest_weight):**  This parameter reflects the importance of self-interest.  A higher value indicates that the responder prioritizes maximizing their monetary gain.


**How the Model Variables Map to Observable Behavior:**

The model maps the variables as follows:  `token_self` and `token_opp` will determine a fairness score (calculated as `token_self / (token_self + token_opp)`), which will then be weighted by `fairness_weight`. `split_self` will be weighted by `self_interest_weight`.  The sum of these weighted components will be the utility.


